// SPDX-License-Identifier: GPL-3.0
pragma solidity >= 0.8.2 <0.9.0;
contract eventOrganization
{
    struct Event 
    {
        address organizer;
        string name;
        uint date;
        uint price;
        uint totalTickets;
        uint remainTickets;
    }
    mapping(uint => Event) public Events;
    mapping (address=>mapping(uint =>uint)) public Tickets;
    uint nextId;

    function eventCreation(string memory name,uint date,uint price,uint totalTickets) external  
    {
        require(date>block.timestamp,"create event for future");
        require(totalTickets>=2,"create event for more than 2 peoples");
        Events[nextId]=Event(msg.sender,name,date,price,totalTickets,totalTickets);
        nextId++;
    }

    function buyTickets(uint id,uint quantity) payable  external 
    {
        require(Events[id].date!=0,"event does Not Exist");
        require(Events[id].date>block.timestamp,"event already occured");
        require(msg.value==Events[id].price*quantity,"Ether is not enough");
        require(Events[id].remainTickets>=quantity);
                Events[id].remainTickets-=quantity;
                Tickets[msg.sender][id]+=quantity;
    }
    function transferTicket(uint id ,uint quantity,address to) external 
    {
        require(Events[id].date!=0,"event does Not Exist");
        require(Events[id].date>block.timestamp,"event already occured");
        require(Tickets[msg.sender][id]>=quantity);
        Tickets[msg.sender][id]-=quantity;
        Tickets[to][id]+=quantity;


    }

}

